import { SignUp } from 'components/indentification/signUp';
import { Link } from 'react-router-dom';

const RegisterPage = () => {
    return (
        <div>
            <h1>Регистрация</h1>
                <SignUp/>
            <p>
                Already have an account? <Link to="/login">Войти</Link>   
            </p>            
        </div>
    )
}

export default RegisterPage
